  void printPrime(term mask,term minterm,int len,char end){
    term printmask=1;
    std::cout << "from Xn <-- X1: ";
    for(int i=len-1;i>=0;i--){
      if(mask&(printmask<<(i))){
        std::cout<<'-';
      }else{
        if(minterm&(printmask<<(i))){
          std::cout<<'1';
        }else{
          std::cout<<'0';
        }
      }
    }
    std::cout << end;
  }

